files = get_data_filenames_from_folder('D:\locs\data\kepco_ismart\의정부점', ext='.xls')
for link in files:
    f = codecs.open(link,'r','utf-8')
    doc = BeautifulSoup(f.read(),'html.parser')

    consumption = doc.find_all('table')[5]
    table = consumption.find_all('table')[-1]
    row = table.find_all('tr')[2:]
    date = link.split('\\')[-1].replace('.xls','').replace('.','-')
    times = []
    energy_list = []
    for item in row:
        time = item.find_all('td')[0].get_text()
        time = date + ' ' + time
        if time != date + ' ' +'24:00':
            time= pd.to_datetime(time) - datetime.timedelta(minutes=15)
        else:
            time=time.replace('24:00','23:45')

        times.append(time)
        energy = item.find_all('td')[1].get_text()
        energy_list.append(energy)

    data  = pd.DataFrame({'Time':times,'Power':energy_list})
    filename = 'D:\locs\data\kepco_ismart\의정부점\\'+ date+'.csv'
    data.to_csv(filename)











